import{_ as t}from"./plugin-vue_export-helper-c27b6911.js";import{o,c as n,b as l,f as e}from"./app-1ed3f6c2.js";const r={},i=e('<h2 id="fp-tcl-command-user-manual" tabindex="-1"><a class="header-anchor" href="#fp-tcl-command-user-manual" aria-hidden="true">#</a> <strong>FP_TCL Command User Manual</strong></h2><p><strong>Dependencies</strong></p><ul><li>sudo apt-get install libunwind-dev</li><li>sudo apt-get install libspdlog-dev (env : ubuntu20.04)</li><li>sudo apt-get install boost 1.71</li><li>sudo apt-get install eigen</li></ul><p><strong>Build</strong></p><p>git clone --recursive<br> cd iEDA<br> mkdir build<br> cd build<br> cmake..<br> make</p><p><strong>Run</strong></p><p>cd iEDA/bin</p><p>./FP gtest.tcl</p><p><strong>Tool Update</strong></p><p>cd iEDA</p><p>git pull</p><p>rm -rf build</p><p>mkdir build</p><p>cd build</p><p>cmake..</p><p>make</p><p><strong>#1. init_floorplan</strong></p><ul><li>-die_area The area of the die, a string, with each value separated by spaces. The values here are not multiplied by DBU.</li><li>-core_area The area of the core, a string, with each value separated by spaces. The values here are not multiplied by DBU.</li><li>-core_site The selection of the core site.</li><li>-io_site For the 110 process, this is an <strong>optional parameter</strong>, and &quot;IOSite&quot; will be selected by default.</li></ul><p>**## Example: **</p><p>set DIE_AREA &quot;0.0 0.0 2843 2843&quot;</p><p>set CORE_AREA &quot;150 150 2693 2693&quot;</p><p>set PLACE_SITE HD_CoreSite</p><p>set IO_SITE IOSite</p><p>init_floorplan \\</p><p>​ -die_area $DIE_AREA \\</p><p>​ -core_area $CORE_AREA \\</p><p>​ -core_site $PLACE_SITE \\</p><p>​ -io_site $IO_SITE</p><p><strong>#2. placeInst</strong></p><p>The tested functions include:</p><ol><li>Placing IOCells</li><li>Placing power CELLs</li><li>Placing IOFILLERs</li><li>Placing CORNERs</li></ol><p>When placing the above four types, placement checks will be performed. The rules are whether they are placed according to IOSite and whether they are on the DIE BOUNDARY.</p><ol start="5"><li>Placing standard cells</li></ol><ul><li>-inst_name The name of the instance.</li><li>-llx The abscissa of the lower left corner. The value at this time is the absolute coordinate, that is, the value after multiplying by DBU should be set.</li><li>-lly The ordinate of the lower left corner.</li><li>-orient Orientation, can use (N, S, W, E) or (R0, R180, R90, R270)</li><li>-cellmaster The type of the cell.</li></ul><p>**## Example: **</p><p>placeInst <br> -inst_name u0_clk <br> -llx 0 <br> -lly 2510940 <br> -orient E <br> -cellmaster PX1W</p><p><strong>#3. placePort</strong></p><p>This command is only for generating ports of IOPINS connected to IOCells. Ports of power CELLs do not use this interface.</p><ul><li>-pin_name The name of the iopin.<br> ​- -offset_x The offset relative to the lower left corner coordinate of the connected IOCell. The absolute length should be set here, that is, the value after multiplying by DBU.<br> ​- -offset_y The offset relative to the lower left corner coordinate of the connected IOCell. The absolute length should be set here, that is, the value after multiplying by DBU.<br> ​- -width The width of the rectangle. The offset relative to the lower left corner coordinate of the connected IOCell. The absolute length should be set here, that is, the value after multiplying by DBU.<br> ​- -height The height of the rectangle. The offset relative to the lower left corner coordinate of the connected IOCell. The absolute length should be set here, that is, the value after multiplying by DBU.<br> ​- -layer The name of the layer it is on.</li></ul><p>**## Example: **</p><p>placePort <br> -pin_name osc_in_pad <br> -offset_x 9000 <br> -offset_y 71500 <br> -width 58000 <br> -height 58000 <br> -layer ALPA</p><p><strong>#4. placeIoFiller</strong></p><p>Place IOFILLERs, supporting automatic filling on four sides.</p><p>Required parameter: -filler_types The type of IOFILLER.</p><p>Optional parameters:</p><ul><li>-prefix The prefix of the generated filler name. The default is IOFill.</li><li>-edge Set which edge to fill. If not set, it is global filling.</li><li>-begin_pos Set to fill within a certain line segment on a certain edge. If not set, the entire edge is filled by default.</li><li>-end_pos The values of begin and pos here are doubles and are values before multiplying by DBU, similar to init.</li></ul><p>**## Example: **</p><p>placeIoFiller <br> -filler_types &quot;PFILL50W PFILL20W PFILL10W PFILL5W PFILL2W PFILL01W PFILL001W&quot;</p><p>​ #-prefix</p><p>​ #-edge</p><p>​ #-begin_pos</p><p>​ #-end_pos</p><p><strong>#5. tapcell</strong></p><p>Place tapcells and endcaps.</p><ul><li>-tapcell Set the type of tapcell.</li><li>-distance 32.5 Set the distance of tapcells. The value here is not multiplied by DBU.</li><li>-endcap The type of endcap.</li></ul><p>**## Example: **</p><p>tapcell <br> -tapcell LVT_FILLTIEHD <br> -distance 32.5 <br> -endcap LVT_F_FILLHD1</p><p><strong>#6. global_net_connect</strong></p><p>Create power nets.</p><ul><li>-net_name The name of the power network.</li><li>-instance_pin_name The name of the pin of the instance connected to this network. Currently, it does not support specifying that the pins of certain instances are connected to this power network. By default, all instances with this pin globally are connected to this network.</li><li>-is_power Should be set to 1 or 0: 1 represents use power, 0 represents use ground.</li></ul><p>**## Example: **</p><p>global_net_connect <br> -net_name VDD <br> -instance_pin_name VDD <br> -is_power 1</p><p>global_net_connect <br> -net_name VDD <br> -instance_pin_name VDDIO <br> -is_power 1</p><p>global_net_connect <br> -net_name VSS <br> -instance_pin_name VSS <br> -is_power 0</p><p><strong>#7. add_pdn_io</strong></p><p>Add IOPINS for the power NET.</p><ul><li>-net_name The name of the power network.</li><li>-direction Parameter (INPUT, OUTPUT, INOUT, FEEDTHRU, OUTTRI), the data direction of the pin.</li><li>-pin_name Optional parameter. The default is the name of the power network.</li></ul><p>**## Example: **</p><p>add_pdn_io <br> -net_name VDD <br> -direction INOUT</p><p>​ #-pin_name VDD</p><p><strong>#8. place_pdn_Port</strong></p><p>Add PORTs for the IOPINS of the power network.</p><ul><li>-pin_name The name of the iopin.</li><li>-io_cell_name The name of the io io cell.</li><li>-offset_x Offset relative to the lower left corner of the port rectangle of the io cell.</li><li>-offset_y Offset relative to the lower left corner of the port rectangle of the io cell.</li><li>-width The width of the rectangle.</li><li>-height The height of the rectangle.</li><li>-layer The routing layer to which the port belongs.</li></ul><p>**## Example: **</p><p>place_pdn_Port <br> -pin_name VDD <br> -io_cell_name xxx<br> -offset_x 10 <br> -offset_y 10 <br> -width 100 <br> -height 100 <br> -layer ALPA</p><p>place_pdn_Port <br> -pin_name VDD <br> -io_cell_name xxx<br> -offset_x 20 <br> -offset_y 20 <br> -width 200 <br> -height 200 <br> -layer ALPA These two commands can add two ports for the VDD pin.</p>',76),a=e("<p><strong>#9. create_grid</strong></p><p>Generate power supply lines for standard cells and generate routing information.</p><ul><li>-layer_name The layer on which the power grid is generated.</li><li>-net_name_power The name of the power net.</li><li>-net_name_ground The name of the ground net.</li><li>-width The line width. The value is not multiplied by DBU.</li><li>-offset The offset relative to the core boundary. It is recommended to set it to 0. Only the case where the offset is 0 has been tested. The value is not multiplied by DBU.</li></ul><p>**## Example: **</p><p>create_grid <br> -layer_name &quot;METAL1&quot; <br> -net_name_power VDD <br> -net_name_ground VSS <br> -width 0.24 <br> -offset 0</p><p><strong>#10. create_stripe</strong></p><p>Generate bar-shaped power supply lines for standard cells.</p><ul><li>-layer_name The layer on which the power supply line is generated.</li><li>-net_name_power The name of the power net.</li><li>-net_name_ground The name of the ground net.</li><li>-width The line width. The value is not multiplied by DBU.</li><li>-pitch The pitch of the same type of power supply lines. For standard cells, the pitch between the power line and the ground line of the same layer is 0.5*pitch.</li><li>-offset The offset relative to the core boundary. The value is not multiplied by DBU.</li></ul><p>**## Example: **</p><p>create_stripe <br> -layer_name &quot;METAL5&quot; <br> -net_name_power VDD <br> -net_name_ground VSS <br> -width 1.64 <br> -pitch 13.12 <br> -offset 3.895</p><p><strong>#11. connect_two_layer</strong></p><p>Connect the specified two layers of power supply lines.</p><ul><li>-layers : Can be input one pair at a time or all the layer information that needs to be connected can be input together.</li></ul><p>**## Example: **</p><p>set connect1 &quot;METAL1 METAL4&quot; <br> set connect2 &quot;METAL4 METAL5&quot; <br> set connect3 &quot;METAL5 METAL6&quot; <br> set connect4 &quot;METAL6 METAL7&quot; <br> set connect5 &quot;METAL7 METAL8&quot; <br> set connect6 &quot;METAL8 ALPA&quot; <br> connect_two_layer <br> -layers [concat $connect1 ​$connect2 ​$connect3 ​$connect4 ​$connect5 $connect6]</p><ol><li>connect_two_layer <br> -layers [concat $connect1 $connect2]</li><li>connect_two_layer <br> -layers &quot;METAL1 METAL4&quot;<br> connect_two_layer <br> -layers &quot;METAL4 METAL5&quot; <strong>The effects of sequence 1 and 2 are the same</strong></li></ol><p><strong>PS: The two layers to be connected need to contain power supply lines</strong></p><p><strong>#12. connect_io_pin_to_pdn</strong></p><p>Connect the Port of the IOPIN of the power NET to the power supply line in the Core. (The coordinates of the Port will be checked)</p><ul><li>-point_list The coordinate points of the corners passed by the connection relationship (the coordinates of the starting point and the ending point also need to be included), or only the starting and ending coordinates can be input.</li><li>-layer The layer on which you want to perform the connection.</li></ul><p>**## Example: **<br> connect_io_pin_to_pdn <br> -point_list &quot;998 2802 915 2598&quot; <br> -layer METAL1</p><p><strong>#13. connect_pdn_stripe</strong></p><ul><li>-point_list The coordinate points of the corners passed by the connection relationship (the starting point and the ending point coordinates also need to be included)</li><li>-net_name The name of the power network you want to connect to</li><li>-layer The layer on which you want to perform the connection<br> **## Example: **<br> connect_pdn_stripe <br> -point_list &quot;2675.606 1998.707 2680.606 1998.707 2680.606 1892.165 2803.686 1892.165&quot; <br> -net_name VDD <br> -layer ALPA</li></ul><p>connect_pdn_stripe <br> -point_list &quot;2675.606 1998.707 2680.606 1998.707&quot; <br> -net_name VDD <br> -layer ALPA <br> -width 100<br> connect_pdn_stripe <br> -point_list &quot;2680.606 1892.165 2803.686 1892.165&quot; <br> -net_name VDD <br> -layer ALPA <br> -width 100</p><p><strong>#14. add_segment_via</strong><br> Add vias to the power supply line.</p><ul><li>-net_name The name of the power supply line.</li><li>-layer The layer where the via is located.</li><li>-top_layer The top layer of the metal layer.</li><li>-bottom_layer The bottom layer of the metal layer.<br> ​- -offset_x The offset relative to the lower left corner coordinate of the connected IOCell. The absolute length should be set here, that is, the value after multiplying by DBU.<br> ​- -offset_y The offset relative to the lower left corner coordinate of the connected IOCell. The absolute length should be set here, that is, the value after multiplying by DBU.<br> ​- -width The width of the rectangle. The offset relative to the lower left corner coordinate of the connected IOCell. The absolute length should be set here, that is, the value after multiplying by DBU.<br> ​- -height The height of the rectangle. The offset relative to the lower left corner coordinate of the connected IOCell. The absolute length should be set here, that is, the value after multiplying by DBU.</li></ul><p>**## Example: **</p><p>add_segment_via <br> -net_name VDD <br> -layer VIA45 <br> -offset_x 9000 <br> -offset_y 71500 <br> -width 58000 <br> -height 58000</p><p>add_segment_via <br> -net_name VDD <br> -layer VIA45 <br> -offset_x 10000 <br> -offset_y 81500 <br> -width 58000 <br> -height 58000</p><p>add_segment_via <br> -net_name VDD <br> -top_layer METAL8 <br> -bottom_layer METAL1 <br> -offset_x 10000 <br> -offset_y 81500 <br> -width 58000 <br> -height 58000</p><p>add_segment_via <br> -net_name VDDIO <br> -top_layer METAL8 <br> -bottom_layer METAL1 <br> -offset_x 10000 <br> -offset_y 81500 <br> -width 58000 <br> -height 58000</p><p><strong>#15. add_segment_stripe</strong></p><ul><li>-point_list The connection points for generating the stripe. When the number of connection points is greater than 2, the front and back connection points generate stripes pairwise.</li><li>-net_name The name of the power network you want to connect to.</li><li>-layer The layer on which you want to perform the connection.</li><li>-width Specify the line width.<br> add_segment_stripe <br> -point_list &quot;2680.606 1892.165 2803.686 1892.165&quot; <br> -net_name VDDIO <br> -layer ALPA <br> -width 100</li></ul><p>add_segment_stripe <br> -point_list &quot;1680.606 2892.165 2803.686 2892.165 2803.686 1792.165&quot; <br> -net_name VDDIO <br> -layer ALPA <br> -width 100</p><p>add_segment_stripe <br> -point_begin &quot;3680.606 2892.165&quot; <br> -layer_start METAL4 <br> -point_end &quot;4680.606 2892.165&quot; <br> -layer_end METAL8 <br> -net_name VDDIO <br> -via_width 100 <br> -via_height 200</p><p><strong>#16. read_lef</strong></p><p>Read the lef file in the form of a string list.</p><p>**## Example: **</p><p>read_lef &quot;../../Designs/scc011u_8lm_1tm_thin_ALPA/scc011u_8lm_1tm_th</p>",39);function p(s,h){return o(),n("div",null,[i,l("![image-20211028162925571](pic/image-20211028162925571.png) "),a])}const _=t(r,[["render",p],["__file","ifp.html.vue"]]);export{_ as default};
